import React from 'react';
import {
  View,
  Text,
  StyleSheet
} from 'react-native';

import DefaultText from './DefaultText';

const MealItem = props => {



  return (
    <View style={styles.mealItem}>
        <View style={{ ...styles.mealRow, ...styles.mealDetail }}>
          <SimpleLineIcons name="energy" size={25} color={tabInfo.tintColor} />
          <DefaultText> Type : {props.type}</DefaultText>
          <DefaultText> Item : {props.item}</DefaultText>
          <DefaultText> Time : {props.time}</DefaultText>
          <DefaultText> Cost : {props.cost}</DefaultText>
        </View>
    </View>
  );
};

const styles = StyleSheet.create({
  mealItem: {
    height: 200,
    width: '100%',
    backgroundColor: '#E7FFE1',
    borderRadius: 10,
    overflow: 'hidden',
    marginVertical: 10
  },
  bgImage: {
    width: '100%',
    height: '100%',
    justifyContent: 'flex-end',
  },
  mealRow: {
    flexDirection: 'row'
  },
  mealHeader: {
    height: '85%'
  },
  mealDetail: {
    paddingHorizontal: 10,
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '15%'
  },
  titleContainer: {
    backgroundColor: 'green',
    paddingVertical: 5,
    paddingHorizontal: 12
  },
  title: {
    fontFamily: 'open-sans-bold',
    fontSize: 20,
    color: 'white',
    textAlign: 'center'
  }
});

export default MealItem;
